Program: |+1
 
 param targetGraphicGroup : any, Basepoint : length[3], Radius, Thickness : length, orientation : string
 
 
 if strToLower(orientation) = "left" then
 	var angle : real := 90
 	var offset : length := -thickness
 else
 	angle := -90
 	offset := thickness
 end
 
 var wheelcolor : integer := makeRGBValue(105, 105, 105)
 
 -- draw cylinder1
 var cylinder := targetgraphicGroup.createConeFrustum(Radius, Radius, Thickness)
 cylinder.Position := Basepoint
 cylinder.Rotation := [angle, 1,0,0]
 cylinder.MaterialActive        := true
 cylinder.MaterialDiffuseColor  := wheelcolor
 cylinder.MaterialAmbientColor  := wheelcolor
 cylinder.MaterialSpecularColor := wheelcolor
 cylinder.MaterialShininess     := 0.2
 
 -- draw cylinder2
 basePoint[2] += offset
 var Radius2 : real := Radius * 0.75
 
 cylinder := targetgraphicGroup.createConeFrustum(Radius2, Radius2, Thickness)
 cylinder.Position := Basepoint
 cylinder.Rotation := [angle, 1,0,0]
 cylinder.MaterialActive        := true
 cylinder.MaterialDiffuseColor  := wheelcolor
 cylinder.MaterialAmbientColor  := wheelcolor
 cylinder.MaterialSpecularColor := wheelcolor
 cylinder.MaterialShininess     := 0.2
